import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  progress: {
    height: 20,
    backgroundColor: 'blue',
    margin: 10,
  },
  progressText: {
    fontSize: 18,
  },
});

export default styles;
